import React, { useState } from 'react'
import { Button, Container } from 'react-bootstrap'
import CreateCatchPhase from '../components/modals/CreateCatchPhase'
import CretateImg from '../components/modals/CreateImg'
import CreateNickname from '../components/modals/CreateNickname'
import CreateOriginDescription from '../components/modals/CreateOriginDescription'
import CreateRealName from '../components/modals/CreateRealName'
import CreateSuperpowers from '../components/modals/CreateSuperpowers'

const Admin = () => {

    const [nicknameVisible, setNicknameVisible] = useState(false)
    const [realNameVisible, setRealNameVisible] = useState(false)
    const [superpowersVisible, setSuperpowersVisible] = useState(false)
    const [originDescriptionVisible, setOriginDescriptionVisible] = useState(false)
    const [imgVisible, setImgVisible] = useState(false)
    const [catchPhaseVisible, setCatchPhaseVisible] = useState(false)

    return (
        <Container className="d-flex flex-column">
            <h1>Добавить Героя</h1>
            <Button 
            variant={"outline-dark"} 
            className="mt-3">
                Nickname HERO</Button>
            <Button 
            variant={"outline-dark"} 
            className="mt-3">
                Reral Name HERO</Button>
            <Button 
            variant={"outline-dark"} 
            className="mt-3">
                Superpowers HERO</Button>
            <Button 
            variant={"outline-dark"} 
            className="mt-3">Origin description HERO</Button>
            <Button 
            variant={"outline-dark"} 
            className="mt-3">Img HERO</Button>
            <Button 
            variant={"outline-dark"} 
            className="mt-3">Catch phase HERO</Button>

            <CreateNickname show={nicknameVisible} onHide={() => setNicknameVisible()} />
            <CretateImg show={imgVisible} onHide={setImgVisible} />
            <CreateSuperpowers show={superpowersVisible} onHide={setSuperpowersVisible} />
            <CreateRealName show={realNameVisible} onHide={setRealNameVisible} />
            <CreateOriginDescription show={originDescriptionVisible} onHide={setOriginDescriptionVisible} />
            <CreateCatchPhase show={catchPhaseVisible} onHide={setCatchPhaseVisible} />
            
        </Container>
    )
}

export default Admin
